obox-content-image\">\n					<img src=\"https://gamification.prestashop.com/api/getAdviceImg/571.png\" alt=\"logo\" style=\"max-width: 85%\">\n				</div>\n				<div class=\"gamification-tip-infobox-content-description\">\n					<p>Czy wiesz, że personalizacja to jeden z najskuteczniejszych sposobów na zwiększenie sprzedaży internetowej przez konwersję? Personalizując swój sklep internetowy, zwracasz się indywidualnie do każdego klienta, prezentując mu produkty, które najbardziej mu się spodobają na każdym etapie jego ścieżki, umożliwiając zwiększenie średniej wartości koszyka o 25% a konwersji o 65%!</p>\r\n<p> </p>\r\n<p>Dzięki Nosto będziesz w stanie:</p>\r\n<p> </p>\r\n<ul>\r\n<li>Zwiększyć średnią wartość koszyka za pomocą rekomendacji cros-selling i up-selling</li>\r\n<li>Zwiększyć wskaźnik konwersji za pomocą odpowiednich rekomendacji</li>\r\n<li>Zwiększyć wskaźnik utrzymania klientów dzięki personalizowanym rekomendacjom</li>\r\n<li>Dowiedzieć się więcej na temat klientów poprzez widok na pulpit w czasie rzeczywistym</li>\r\n<li>Zmniejszyć współczynnik odrzuceń</li>\r\n<li>Natychmiast rozpocząć działanie dzięki niezawodnej 2-minutowej instalacji, modelowi kosztów „zero sprzedaży/zero faktur” i bez minimalnego czasu trwania umowy.</li>\r\n</ul>					<div class=\"gamification-tip-infobox-content-controls right\">\n						<a href=\"javascript:$.fancybox.close();\" class=\"button\"></a>\n						<a href=\"{link}AdminModules{/link}&install=nostotagging&module_name=nostotagging\" class=\"button success\"></a>\n					</div>\n				</div>\n			</div>\n		</div>\n	</div>\n</div>\n</div>\n<script>\n	$(document).ready( function () {\n		$(\'.gamification_fancybox\').bind(\'click\', function () {\n			id_advice = 571;\n			popin_url = \'https://gamification.prestashop.com/get_advice_link.php?id_advice=\'+id_advice+\'&url=\';\n			url = window.location.origin+window.location.pathname.replace(\'index.php\', \'\')+$(\'.gamification-tip-infobox-content-controls a.success\').attr(\'href\');\n			$(\'.gamification-tip-infobox-content-controls a.success\').attr(\'href\', popin_url+encodeURIComponent(url));\n			\n			$(\'.gamification-tip-infobox\').after(\'<img style=\"display:none\" src=\"https://gamification.prestashop.com/api/getAdvicePopinImg/\'+id_advice+\'.png\" />\');\n			\n		});\n	});\n</script></div>'),(19,1,'<div id=\"wrap_id_advice_605\" >\n	<div class=\"col-lg-6\">\n		<section id=\"\" class=\"panel panel-advice\">\n			<a href=\"#\" id=\"605\" class=\"close_link gamification_premium_close\">\n				<i class=\"icon-remove\"></i>\n			</a>\n			<span class=\"gamification-close-confirmation hide\">\n				Are you sure?\n				<button class=\"btn btn-default btn-sm\" data-advice=\"delete\"><i class=\"icon-trash\"></i> Delete</button>\n				<button class=\"btn btn-default btn-sm\" data-advice=\"cancel\">Cancel</button>\n			</span>\n			<a class=\"preactivationLink row\" rel=\"psphipay\" href=\"{link}AdminModules{/link}&install=psphipay&module_name=psphipay&redirectconfig\">\n				<img src=\"https://api.prestashop.com/partner/premium/images/psphipay.png\" class=\"advice-img img-thumbnail\">\n				<img src=\"https://gamification.prestashop.com/api/getAdviceImg/605.png\"/ class=\"hide\">\n				<p class=\"advice-description\">Akceptuj płatności online za pośrednictwem popularnych europejskich środków płatności<br/></p>\n			</a>\n		</section>\n	</div></div>'),(20,1,'<div id=\"wrap_id_advice_639\" >\n	<div class=\"col-lg-6\">\n		<section id=\"\" class=\"panel panel-advice\">\n			<a href=\"#\" id=\"639\" class=\"close_link gamification_premium_close\">\n				<i class=\"icon-remove\"></i>\n			</a>\n			<span class=\"gamification-close-confirmation hide\">\n				Are you sure?\n				<button class=\"btn btn-default btn-sm\" data-advice=\"delete\"><i class=\"icon-trash\"></i> Delete</button>\n				<button class=\"btn btn-default btn-sm\" data-advice=\"cancel\">Cancel</button>\n			</span>\n			<a class=\"preactivationLink row\" rel=\"dotpay\" href=\"{link}AdminModules{/link}&instal